/* eslint-disable no-use-before-define */
import React from "react";
import TextField from "@material-ui/core/TextField";
import { makeStyles, createStyles } from "@material-ui/core/styles";
import Autocomplete from "@material-ui/lab/Autocomplete";
import InputAdornment from "@material-ui/core/InputAdornment";
import IconButton from "@material-ui/core/IconButton";
import SearchIcon from "@material-ui/icons/Search";

const searchData = [
  "Salem Community Fridge",
  "Salisbury Fridge",
  "Sheffield Fridge",
  "Springfield Community Fridge",
  "Somerville Community Fridge",
  "Somerset Community Fridge",
  "Southampton Fridge",
  "Southwick Fridge",
  "South End Fridge",
  "South Hadley Community Fridge",
];

const useStyles = makeStyles((theme) =>
  createStyles({
    root: {
      padding: "2px 4px",
      display: "flex",
      alignItems: "center",
      width: 400,
    },
    input: {
      marginLeft: theme.spacing(1),
      flex: 1,
    },
    iconButton: {
      padding: 10,
    },
    divider: {
      height: 28,
      margin: 4,
    },
  })
);

export default function CoreSearchBar() {
  const classes = useStyles();
  return (
    <div style={{ width: 400 }}>
      <Autocomplete
        freeSolo
        options={searchData}
        renderInput={(params) => (
          <TextField
            {...params}
            variant="outlined"
            placeholder="Search for a fridge"
            InputProps={{
              startAdornment: (
                <InputAdornment position="start">
                  <SearchIcon />
                </InputAdornment>
              ),
              ...params.InputProps, 
            }}
          />
        )}
      />
    </div>
  );
}
